const url = 'https://dummyjson.com/products';
const CONFIG = {
  BASE_URL: url,
  DEFAULT_AMOUNT: 10,
  DEFAULT_DATA: ['id', 'title', 'description', 'thumbnail'],
  CATEGORY: 'smartphones',
};

export default CONFIG;
